import React from "react";
import { Route } from "react-router-dom";
import { BrowserRouter } from "react-router-dom";

const App = () => {
  return (
    <BrowserRouter>
      <Route path="/" exact component={App1}></Route>
      <Route path="/page2" component={App2}></Route>
    </BrowserRouter>
  );
};

const App1 = () => {
  return <div>Motoro 1</div>;
};

const App2 = () => {
  return <div>Motoro 2</div>;
};

export default App;
